import React from "react";
import ReactDOM from 'react-dom';
import Cards from './Cards'
import Sdata from "./Sdata";
import './index.css'

function ncard(val){
    return(
        <Cards
            imgsrc={val.imgsrc}
            title={val.title}
            seriesName={val.seriesName}
            link={val.link}
        />
    )
}

ReactDOM.render(
    <>
        <h1 className="heading_style">List of top 5 movies in 2020 to watch</h1>

        {Sdata.map(ncard)}
    </>, document.getElementById('root')
)
